package com.vekomy.vbooks.spring.page;

public class Page {

	/**
	 * String variable holdes name.
	 */
	private String name;

	/**
	 * String variable holdes url.
	 */
	private String url;

	/**
	 * String variable holdes linksUrl.
	 */
	private String linksUrl;

	/**
	 * String variable holdes label.
	 */
	private String label;

	/**
	 * String variable holdes icon.
	 */
	private String icon;

	/**
	 * 
	 */
	public Page() {
		// TODO Auto-generated constructor stub
	}

	/**
	 * @return the name
	 */
	public String getName() {
		return name;
	}

	/**
	 * @param name
	 *            the name to set
	 */
	public void setName(String name) {
		this.name = name;
	}

	/**
	 * @return the url
	 */
	public String getUrl() {
		return url;
	}

	/**
	 * @param url
	 *            the url to set
	 */
	public void setUrl(String url) {
		this.url = url;
	}

	/**
	 * @return the linksUrl
	 */
	public String getLinksUrl() {
		return linksUrl;
	}

	/**
	 * @param linksUrl
	 *            the linksUrl to set
	 */
	public void setLinksUrl(String linksUrl) {
		this.linksUrl = linksUrl;
	}

	/**
	 * @return the label
	 */
	public String getLabel() {
		return label;
	}

	/**
	 * @param label
	 *            the label to set
	 */
	public void setLabel(String label) {
		this.label = label;
	}

	/**
	 * @return the icon
	 */
	public String getIcon() {
		return icon;
	}

	/**
	 * @param icon
	 *            the icon to set
	 */
	public void setIcon(String icon) {
		this.icon = icon;
	}

}
